function Header() {
    return (
        <header className="header-header">
            <nav className="navbar left-nav">
                <a href="#" className="link shop-link">Shop</a>
                <a href="#" className="link Blog-link">Blog</a>
                <a href="#" className="link Contact-link">BlContactog</a>
            </nav>
            <div className="logo-container">
                <h1 className="logo">Logo</h1>
            </div>
            nav.navbar
        </header>
    );
}

export default Header;
